import {UserFacade} from "./user-facade";
import {User} from "../../data-classes/user";

let userFacade;
let loggedInUser;

describe('UserFacade Tests', () => {

  beforeAll((done) => {
    userFacade = new UserFacade();
    userFacade.logInUser('sonalee@gmail.com', 'sonalee123', function (bool: boolean) {
      if (bool) {
        done();
      }
    });
  });

  it('Test: should return logged in user', function () {
    loggedInUser = userFacade.getLoggedInUser();
    expect(loggedInUser.username).toBe('sonalee123');
  });

  it('Test: should return user with specified username', function (done) {
    userFacade.getUserByEmail(loggedInUser.email, function (user: User) {
      expect(user.email).toBe(loggedInUser.email);
      expect(user.username).toBe(loggedInUser.username);
      done();
    });
  });

  it('Test: should get logged in user score', function () {
    var score = userFacade.getUserScore();
    expect(score).toBe(loggedInUser.score);
  });

  it('Test: should return score for specified user', function (done) {
    userFacade.getScore(loggedInUser.id, function (score: number) {
      expect(score).toBe(loggedInUser.score);
      done();
    });
  });

  it('Test: should update logged in user email', function (done) {
    userFacade.updateEmail('sonalee1@gmail.com', function (bool: boolean) {
      var updatedUser = userFacade.getLoggedInUser();
      if (bool) {
        expect(updatedUser.email).toBe('sonalee1@gmail.com');
        done();
      }
    });
  });

  it('Test: should update logged in user password', function (done) {
    userFacade.updatePassword('newPassword', function (bool: boolean) {
      expect(bool).toBeTruthy();
      done();
    });
  });

  it('Test: should update logged in user score', function (done) {
    var updatedScore = loggedInUser.score +10;
    userFacade.updateScore(10, function (score: number) {
      expect(score).toBe(updatedScore);
      done();
    });
  });

  it('Test: should update logged in user profile picture', function (done) {
    var profilePic = 'data:image/png;base64,'
    userFacade.addProfilePicture(profilePic, function (bool: boolean) {
      var updatedUser = userFacade.getLoggedInUser();
      expect(bool).toBeTruthy();
      expect(updatedUser.base64Image).toBe(profilePic);
      done();
    });
  });

  it('Test: should create new user', function (done) {
    userFacade.createUser('userfacade', 'password', 'userfacade@gmail.com', function (id: string) {
      userFacade.getUserByEmail('userfacade@gmail.com', function (user: User) {
        expect(user.id).toBe(id);
        done();
      });
    });
  });

});
